css:
body {
    background-color: #202124;
    color: #a580ff;
    direction: ltr;
    font-family: "Roboto",arial,sans-serif;
    font-size: 15px;
    margin: 0;
    min-width: 360px;
    overflow-x: hidden;
    overflow-y: auto;
    padding: 0;
}

::-webkit-scrollbar-track {
    background-clip: padding-box;
    border: solid #a580ff8a;
    border-width: 0 0 0 4px;
}
